import {Button, Col, Form, FormGroup, Input, Label, Row} from "reactstrap";
import React from "react";

const HomePage2=()=>{
    return(
        <div>
            <Row>
                <Col lg={
                    {offset:4,size:3}
                } md={4} sm={6} xs={12}
                >

                    <Form onSubmit>
                        <FormGroup>
                            <Label>Username:</Label>
                            <Input type="text" />
                        </FormGroup>
                        <FormGroup>
                            <Label>Password:</Label>
                            <Input type="text" />
                        </FormGroup>

                        <FormGroup>
                            <Label>Password:</Label>
                            <Input type="text" />
                        </FormGroup>
                        <FormGroup>
                            <Button type ="submit" value="submit " >submit</Button> {' '}
                            <Button value="submit " style={{marginLeft:20}}>login</Button>
                        </FormGroup>
                    </Form>

                </Col>
            </Row>
        </div>
    )
}

export default HomePage2
